window.bookSummaryJSON = "<p><b>Casmir and his allies have struck a devastating blow to the powerful prince who sent invaders into their star system, but war still rages at home. </b></p> <p>Worse, the prince has escaped with a lethal bioweapon, and he intends to wipe out all human life on Odin. Casmir could lose his parents, his friends, and everyone he holds dear. </p> <p>On top of all that, the Kingdom fleet commander Jorg has captured two of Casmir's friends to ensure his “compliance.\" But Jorg wants a bioweapon of his own as well as the deadly crushers that Casmir has made. To side with him would be to side with the devil. But if Casmir doesn’t, he may never see his friends alive again.</p>"; 
